import React from 'react';
import './App.css';  // Assuming you put your styles in App.css

function App() {
  const showTab = (tabId) => {
    const tabContents = document.querySelectorAll('.tab-content');
    for (let content of tabContents) {
        content.classList.remove('active');
    }
    document.getElementById(tabId).classList.add('active');
  }

  const getOldCustomerData = () => {
    const customerId = document.getElementById('customerId').value;
    document.getElementById('results').value = "Data for customer with ID: " + customerId;
  }
  const handleSaveToCSV = () => {
    // Get table data from form
    const tableRows = document.querySelectorAll('#newCustomer tbody tr');
    const data = Array.from(tableRows).map(row => {
        const inputs = row.querySelectorAll('input');
        return Array.from(inputs).map(input => input.value);
    });

    // Convert data to a format suitable for sending to server
    const columns = ['CUST_ID', 'BALANCE', 'BALANCE_FREQUENCY', 'PURCHASES',
                     'ONEOFF_PURCHASES', 'INSTALLMENTS_PURCHASES', 'CASH_ADVANCE',
                     'PURCHASES_FREQUENCY', 'ONEOFF_PURCHASES_FREQUENCY',
                     'PURCHASES_INSTALLMENTS_FREQUENCY', 'CASH_ADVANCE_FREQUENCY',
                     'CASH_ADVANCE_TRX', 'PURCHASES_TRX', 'CREDIT_LIMIT','TENURE'];
    const payload = data.map(row => {
        const obj = {};
        row.forEach((value, index) => {
            obj[columns[index]] = value;
        });
        return obj;
    });

    // Send data to Flask backend
    fetch("http://localhost:5000/save-csv", {
        method: 'POST',
        headers: {
            'Content-Type': 'application/json',
        },
        body: JSON.stringify(payload[0]),  // send the first row for simplicity
    })
    .then(response => response.json())
    .then(data => {
        console.log(data.message);
    })
    .catch((error) => {
        console.error('Error:', error);
    });
}


  return (
    <div className="App">
      <img src={process.env.PUBLIC_URL + '/images/axefinance.png'} id="topRightImage" alt="Description of Image" />
      <div className="tabs">
        <button className="tab-button" onClick={() => showTab('newCustomer')}>New Customer</button>
        <button className="tab-button" onClick={() => showTab('oldCustomer')}>Old Customer</button>
      </div>

      <div id="newCustomer" className="tab-content active">
      <table>
        <thead>
            <tr>
                <th>CUST_ID</th>
                <th>BALANCE</th>
                <th>BALANC_FREQUENCY</th>
                <th>PURCHASES</th>
                <th>ONEOFF_PURCHASES</th>
                <th>INSTALLMENTS_PURCHASES</th>
                <th>CASH_ADVANCE</th>
                <th>PURCHASES_FREQUENCY</th>
                <th>ONEOFF_PURCHASES_FREQUENCY</th>
                <th>PURCHASES_INSTALLMENTS_FREQUENCY</th>
                <th>CASH_ADVANCE_FREQUENCY</th>
                <th>CASH_ADVANCE_TRX</th>
                <th>PURCHASES_TRX</th>
                <th>CREDIT_LIMIT</th>
                <th>TENURE</th>
            </tr>
        </thead>
        <tbody>
            <tr>
                <td><input type="text" /></td>
                <td><input type="text" /></td>
                <td><input type="text" /></td>

                <td><input type="text" /></td>
                <td><input type="text" /></td>
                <td><input type="text" /></td>

                <td><input type="text" /></td>
                <td><input type="text" /></td>
                <td><input type="text" /></td>

                <td><input type="text" /></td>
                <td><input type="text" /></td>
                <td><input type="text" /></td>

                <td><input type="text" /></td>
                <td><input type="text" /></td>
                <td><input type="text" /></td>
            </tr>
        </tbody>
    </table>
    <br />
    <div style={{textAlign: "center"}}>
    <button onClick={handleSaveToCSV}>Submit</button>
    </div>
      </div>

      <div>
    <div id="oldCustomer" className="tab-content">
        <label htmlFor="customerId">Customer ID:</label>
        <input type="text" id="customerId" />
    <br />
      <div>
        <label>Results:</label>
        <textarea readOnly id="results"></textarea>
      </div>
    <br />
    <div style={{textAlign: "center"}}>
        <button onClick={getOldCustomerData}>Fetch Data</button>
    </div>
    </div>
    </div>
    </div>
  );
}

export default App;
